import React, { useState, useEffect } from "react";
import "./UserDashboard.css";

function UserDashboard() {
  const [nombreUsuario, setNombreUsuario] = useState("");
  const [nuevoNombreUsuario, setNuevoNombreUsuario] = useState("");
  const [dni, setDni] = useState("");
  const [nuevaContrasena, setNuevaContrasena] = useState("");
  const [misUnidades, setMisUnidades] = useState([]);
  const [mensaje, setMensaje] = useState("");
  const [error, setError] = useState("");

  // Fetch para actualizar el nombre de usuario
  const actualizarNombreUsuario = async () => {
    try {
      const response = await fetch("http://localhost:8080/actualizar-nombre-usuario", {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${localStorage.getItem("jwtToken")}`,
        },
        body: JSON.stringify({ nuevoNombreUsuario }),
      });

      if (response.ok) {
        setMensaje("Nombre de usuario actualizado con éxito");
      } else {
        const errorData = await response.json();
        setError(errorData.message || "Error actualizando el nombre de usuario");
      }
    } catch (e) {
      setError("Error al conectar con el servidor");
    }
  };

  // Fetch para restablecer la contraseña
  const restablecerContrasena = async () => {
    try {
      const response = await fetch("http://localhost:8080/restablecerContrasena", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ nombreUsuario, dni, nuevaContrasena }),
      });

      if (response.ok) {
        setMensaje("Contraseña restablecida correctamente");
      } else {
        const errorData = await response.json();
        setError(errorData.message || "Error restableciendo contraseña");
      }
    } catch (e) {
      setError("Error al conectar con el servidor");
    }
  };

  // Fetch para obtener las unidades
  const obtenerMisUnidades = async () => {
    try {
      const response = await fetch("http://localhost:8080/mis-unidades", {
        method: "GET",
        headers: {
          Authorization: `Bearer ${localStorage.getItem("jwtToken")}`,
        },
      });

      if (response.ok) {
        const data = await response.json();
        setMisUnidades(data);
      } else {
        const errorData = await response.json();
        setError(errorData.message || "Error obteniendo unidades");
      }
    } catch (e) {
      setError("Error al conectar con el servidor");
    }
  };

  useEffect(() => {
    obtenerMisUnidades();
  }, []);

  return (
    <div className="user-dashboard">
      <header className="dashboard-header">
        <h1 className="dashboard-title">PROPSUITE</h1>
        <nav className="header-buttons">
          <button className="nav-button">Usuario</button>
          <button className="nav-button">Reclamos</button>
          <button className="nav-button">Unidades</button>
        </nav>
      </header>

      <div className="welcome-section">
        <h2 className="welcome-title">PROPSUITE</h2>
        <p className="welcome-subtitle">
          Bienvenidos a nuestro sistema, diseñado para hacer tu gestión fácil y
          dinámica.
        </p>
      </div>

      {/* Sección Usuario */}
      <div className="section-container">
        <h2 className="section-title">Usuario</h2>
        <div className="input-group">
          <label>Nuevo Nombre de Usuario:</label>
          <input
            type="text"
            value={nuevoNombreUsuario}
            onChange={(e) => setNuevoNombreUsuario(e.target.value)}
          />
        </div>
        <button className="section-button" onClick={actualizarNombreUsuario}>
          Actualizar Nombre de Usuario
        </button>

        <div className="input-group">
          <label>Nombre de Usuario:</label>
          <input
            type="text"
            value={nombreUsuario}
            onChange={(e) => setNombreUsuario(e.target.value)}
          />
          <label>DNI:</label>
          <input
            type="text"
            value={dni}
            onChange={(e) => setDni(e.target.value)}
          />
          <label>Nueva Contraseña:</label>
          <input
            type="password"
            value={nuevaContrasena}
            onChange={(e) => setNuevaContrasena(e.target.value)}
          />
        </div>
        <button className="section-button" onClick={restablecerContrasena}>
          Restablecer Contraseña
        </button>
      </div>

      {/* Sección Unidades */}
      <div className="section-container">
        <h2 className="section-title">Unidades</h2>
        {misUnidades.length > 0 ? (
          <ul>
            {misUnidades.map((unidad, index) => (
              <li key={index}>{unidad}</li>
            ))}
          </ul>
        ) : (
          <p>No se encontraron unidades.</p>
        )}
      </div>

      {/* Mensajes */}
      {mensaje && <div className="success-message">{mensaje}</div>}
      {error && <div className="error-message">{error}</div>}
    </div>
  );
}

export default UserDashboard;
